```typescript
async () => {
  const response = await CRICKET_API.callApi({
    endpoint: "documents",
    method: "GET",
    params: {
      sort: "+updated",
    },
  });

  expect(response).toHaveStatusCode(200);
  expect(response.duration).toHaveResponseTimeBelow(10);
  expect(response.data).toStrictEqual({
    count: expect.any(Number),
    offset: expect.any(Number),
    limit: expect.any(Number),
    results: expect.any(Array),
  });
  expect(response.data).toMatchSchema("updated-ascending-order-response");
};

